import React from "react";
import logo from './logo.svg';
import './App.css';

function fetchRandom() {
  console.log('rand!');
}

function App() {

  const randomEdgeURL = "https://autumn-hall-70d7.skyflare.workers.dev/?max=9999999";

  React.useEffect(() => { fetchRandom(); }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to <strong>Flares</strong>!!!
        </p>
        <a
          className="App-link"
          href="https://example.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          I love flares!
        </a>
      </header>
    </div>
  );
}

export default App;
